--
-- Name: trucks_with_types_and_runs; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW trucks_with_types_and_runs AS
 SELECT trucks.station_id,
    trucks.id AS truck_id,
    truck_types.type,
    truck_runs.runs
   FROM ((trucks
     JOIN truck_types ON ((truck_types.id = trucks.type_id)))
     JOIN truck_runs ON (((truck_runs.station_id = trucks.station_id) AND (truck_runs.truck_id = trucks.id))))
  ORDER BY trucks.station_id, trucks.id;


